script: |
  super -f text -I q2567.spq | sort > q2567.out

inputs:
  - name: q2567.spq
    data: |
      SELECT col1 AS col0 FROM tab2 (FORMAT parquet) cor0 WHERE NOT - col2 / - ( col0 * - 70 ) BETWEEN - 32 + 83 AND col0 * col2;
  - name: tab2

outputs:
  - name: q2567.out
    data: |
      51
      67
      77
